  <style media="screen">

    #corps{
      animation-name: corpsAvance;
      animation-duration: 7.5s;
      animation-iteration-count: 1;
      animation-timing-function: linear;
      animation-delay: 1s;
      transform-origin: 50px 50px;
    }

      #etudiant_bras{
        animation-name: brasBouge;
        animation-duration: 1.5s;
        animation-iteration-count: 5;
        animation-timing-function: linear;
        animation-delay: 1s;
        transform-origin: 48% 35%;
      }
      #jambe_gauche{
        animation-name: jambeBouge;
        animation-duration: 1.5s;
        animation-iteration-count: 5;
        animation-timing-function: linear;
        animation-delay: 1s;
        transform-origin: 60% 75%;
      }
      #jambe_droite{
        animation-name: jambeDroiteBouge;
        animation-duration: 1.5s;
        animation-iteration-count: 5;
        animation-timing-function: linear;
        animation-delay: 1s;
        transform-origin: 48% 50%;
      }
      #svgcontent{
        animation-name: sauter;
        animation-duration:4s;
        animation-timing-function:linear;
        animation-iteration-count: infinite;

        width:600px;
        height: 600px;
      }

      @keyframes corpsAvance {
        0% {transform: translate(0);}
        50% {transform: translate(-150px,50px);}
        100% {transform: translate(-300px,100px);}
      }

      @keyframes brasBouge {
        0% {transform: rotate(0);}
        50% {transform: rotate(10deg);}
        100% {transform: rotate(0);}
      }
      @keyframes jambeBouge {
        0% {transform: rotate(0);}
        50% {transform: rotate(5deg);}
        100% {transform: rotate(0);}
      }
      @keyframes jambeDroiteBouge {
        0% {transform: rotate(0);}
        50% {transform: rotate(5deg);}
        100% {transform: rotate(0);}
      }

    </style>
